import React, { useState } from 'react';
import { Lock, Plus, Minus, Package } from 'lucide-react';
import './dboard.css';
const systems = [
  { name: "Main Building", sub: "Lobby" },
  { name: "Residence Hall", sub: "First Floor" },
  { name: "Gym", sub: "Entrance" }
];

const Dashboard = () => {
  const [selectedSystem, setSelectedSystem] = useState("Main Building");
  const lockers = Array.from({ length: 18 }, (_, i) => ({
    id: `0${Math.floor(i / 6) + 1}-0${(i % 6) + 1}`,
    occupied: false
  }));

  return (
    <div className="p-4 font-sans">
      <div className="text-3xl font-bold mb-4">Community Manager Dashboard</div>

      <div className="flex space-x-6">
        {/* Sidebar - Systems */}
        <div className="w-1/4 border rounded-lg p-4">
          <div className="font-semibold text-lg mb-2">Locker Systems</div>
          <p className="text-sm text-gray-500 mb-4">Manage your locker systems for community <strong>COM001</strong></p>
          <button className="bg-blue-500 text-white px-3 py-1 rounded text-sm mb-3">
            + Add System
          </button>

          <ul>
            {systems.map((sys) => (
              <li
                key={sys.name}
                className={`p-2 rounded cursor-pointer ${selectedSystem === sys.name ? "bg-blue-500 text-white" : "hover:bg-gray-100"}`}
                onClick={() => setSelectedSystem(sys.name)}
              >
                <div className="font-medium">{sys.name}</div>
                <div className="text-sm text-gray-300">{sys.sub}</div>
              </li>
            ))}
          </ul>
        </div>

        {/* Main Content */}
        <div className="flex-1 border rounded-lg p-4">
          <div className="flex justify-between items-center mb-4">
            <div>
              <div className="text-xl font-semibold">{selectedSystem}</div>
              <div className="text-sm text-gray-500">Lobby - Main building lobby lockers</div>
            </div>
            <button className="bg-blue-500 text-white px-3 py-1 rounded flex items-center gap-1">
              <Package size={16} /> Store Package
            </button>
          </div>

          <div className="flex items-center gap-4 mb-4">
            <button className="bg-blue-500 text-white px-3 py-1 rounded flex items-center gap-1">
              <Plus size={16} /> Add Lockers
            </button>
            <button className="bg-red-500 text-white px-3 py-1 rounded flex items-center gap-1">
              <Minus size={16} /> Remove Lockers
            </button>
          </div>

          <div className="mb-2 text-sm">
            <span className="inline-block mr-4"><span className="w-3 h-3 inline-block bg-green-500 rounded-full mr-1"></span>Available</span>
            <span className="inline-block"><span className="w-3 h-3 inline-block bg-red-500 rounded-full mr-1"></span>Occupied</span>
          </div>

          {/* Locker Grid */}
          <div className="grid grid-cols-6 gap-4">
            {lockers.map((locker) => (
              <div
                key={locker.id}
                className={`border rounded-lg p-4 flex flex-col items-center justify-center text-sm font-medium ${
                  locker.occupied ? "bg-red-100 border-red-400 text-red-600" : "bg-green-100 border-green-400 text-green-600"
                }`}
              >
                <Lock size={20} />
                {locker.id}
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
